import React from "react";
import "./todoItem.css";

const TodoItem = (props) => {
    const taskComplete = (event)=>{
        console.log(event);
    }
    return(
  <li className="todoItem">
    <input className="todoItem__checkbox"
     type="checkbox"
     inline={true}
    /* checked={this.props.checkBoxDefaultStatus} */
     onChange={taskComplete}
     ></input>
    <p className={`todoItem__task ${props.completed && "task-done"}`}>
      {props.text}
    </p>
    <span className="todoItem__close">X</span>
  </li>
);}

export { TodoItem };
